import React from "react";
import Header from "../../Components/header";
import "./style.css";
export default function SignIn() {
  return (
    <div className="signin_wrapper">
      <Header />
      <div className="signin_content">
        <div className="signin_col1">
          <span style={{ fontWeight: 600, fontSize: "30px" }}>
            Customer Sign In
          </span>
          <div className="line"></div>
          {error && (
            <span style={{ color: "red", margin: "1rem", marginLeft: "0" }}>
              <img
                src="https://cdn-icons-png.flaticon.com/512/463/463612.png"
                alt=""
                style={{
                  width: "20px",
                  height: "20px",
                  transform: `translate(${-3}px, ${3}px)`,
                }}
              />
              Fields with * are required.
            </span>
          )}
          <span>If you have an account, sign in with your email address.</span>
          <div className="input_field_wrapper">
            <span className="input_label">Email *</span>
            <input type="text" className="ship_input" />
          </div>
          <div className="input_field_wrapper">
            <span className="input_label">Password *</span>
            <input type="text" className="ship_input" />
          </div>
        </div>
      </div>
    </div>
  );
}
